class Equipment extends Component{
    render(){
        return(
            <div>
                <Row className="inventory">
                    <BasicSideNav />
                    <Col xs={9} className="column">
                        world
                    </Col>
                </Row>
            </div>
        );
    }
}

export default Equipment;
